import React from 'react'
import { StyleSheet } from 'react-native'
import { View, Text } from 'react-native'

export default function TopBar(){
    return (
        <View>
            <Text>opa</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        height: "25%",
        width: 100
    }
})
